import React from "react";

const Images_preview = ({ Images, OnClick }) => {
  const Images_Show = Array.from(Images).map((Element, index) => {
    if (index <= 5) {
      return (
        <img
          OnClick={OnClick}
          className="ui small image"
          key={index}
          src={Element}
        />
      );
    } else {
      return <div></div>;
    }
  });

  return <div className="ui mini images">{Images_Show}</div>;
};

export default Images_preview;
